import React from 'react';
import './App.css';
import Button from './components/Button'

class App extends React.Component {
  render() {
    return (
      <>
        <Button text="Click no botao 2!" bname="Botao 1" />
        <Button text="Mais um clique!" bname="Botao 2" />
        <Button text="Outro click" bname="Botao 3" />
      </>
    );
  }
};

export default App;
